import React from 'react'
// import './assests/gallery.css';
import {ThemeContext} from './ThemeContext.js';

const PhotoList = ({photos, loading}) => {
    if(loading){
        return <h2>Loading...</h2>;
    }

    return (
        <ThemeContext.Consumer>
            {({theme, toggleTheme}) => (
                <div className="container mt-3" id="photo-list-container" style={{backgroundColor: theme.backgroundColor}}>
                    <ul className="photo-list list-group mb-4" style={{backgroundColor: theme.backgroundColor}}>
                        {photos.map(photo =>(
                            <li key={photo.id} className="imageRow list-group-item" style={{backgroundColor: theme.backgroundColor}}>
                                <img src={photo.url} className="img-fluid" alt="Responsive image" width="100" height="100" />
                            </li>
                        ))}
                    </ul>
                </div>
            )}
        </ThemeContext.Consumer>
    )
}

export default PhotoList
